import React, { Component } from 'react';
import './Notifications.css';

class Notification extends Component {
  render() {
    return (
      <div className="notification-page">
        <h2 className="notification-title">Notifications</h2>

        <div className="notification-card">
          <div className="notification-info">
            <p className="notification-title-text">10 Bread loaves</p>
            <p className="notification-meta">Expires in 2 days</p>
          </div>
          <span className="notification-status status-warning">Soon</span>
        </div>

        <div className="notification-card">
          <div className="notification-info">
            <p className="notification-title-text">500g Cheese</p>
            <p className="notification-meta">Expired 3 weeks ago</p>
          </div>
          <span className="notification-status status-expired">Expired</span>
        </div>

        <div className="notification-card">
          <div className="notification-info">
            <p className="notification-title-text">1L Milk Cartons</p>
            <p className="notification-meta">Expires in 2 weeks</p>
          </div>
          <span className="notification-status status-good">Good</span>
        </div>
      </div>
    );
  }
}

export default Notification;
